import Navbar from "./components/Navbar";
import Home from "./components/Home";
import SocialMedia from "./components/SocialMedia";

function App() {
  return (
    <div>
      <Navbar />
      <Home/>
      
      <SocialMedia/>
    </div>
  );
}

export default App;
